                    <h6 class=""heading underline font-x2"">MCBÜ Hafsa Sultan Hastanesi’nde PostCovid Polikliniği Hizmete Başladı</h6>
                    <p>MCBÜ Hafsa Sultan Hastanesi’nde COVID-19 enfeksiyonu sonrası uzun dönem şikayetleri devam eden hastalara yönelik PostCovid Polikliniği hizmete başladı. Hasta kabulüne başlayan poliklinikte enfeksiyonu geçiren, ancak özellikle akciğer tutulumuna bağlı solunum şikayetleri devam eden hastaların gözlem ve tedavileri yapılacak.</p>
                    <p class=""btmspace-30"">
                        Göğüs Hastalıkları A");
            WriteLiteral(@"nabilim Dalı bünyesinde faaliyete başlayan Postcovid polikliniğinde, alanında uzman göğüs hastalıkları hekimleri hasta kabulünü gerçekleştirecekler. Konu ile ilgili bilgi veren MCBÜ Tıp Fakültesi Göğüs Hastalıkları Anabilim Dalı Öğretim Üyesi Doç. Dr. Yavuz Havlucu, ""COVID-19 geçen yıl ortaya çıkmış bir hastalık olmasına rağmen şimdiden hastalığa yakalananların eski sağlıklarına kavuşmalarının uzun zaman aldığını söyleyebiliyoruz. Korona virüse yakalanan bir kişinin iyileşme süresi, hastalığı ne kadar ağır geçirdiğiyle ilişkili olabilse de her zaman doğru orantılı olmayabiliyor.“Çeşitli şikayetlerle gelen hastaların gün geçtikçe artması ve bu hastaların daha ayrıntılı değerlendirilebilmesi için Manisa Celal Bayar Üniversitesi Göğüs Hastalıkları Kliniğinde Post COVID polikliniği hayata geçirilmiştir..

